import React, { useState } from 'react';

const Profile = () => {
    // State for user information
    const [userInfo, setUserInfo] = useState({
        name: 'John Doe',
        email: 'john.doe@example.com',
        dob: '1990-01-01',
        address: '123 Main St'
    });

    // Handle change in input fields
    const handleChange = (e) => {
        setUserInfo({ ...userInfo, [e.target.name]: e.target.value });
    }

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit the updated user info to the server
        console.log('Updated Information:', userInfo);
    }

    return (
        <div className="user-profile">
            <form onSubmit={handleSubmit}>
                <div className="basic-info">
                    <img src="path-to-avatar.jpg" alt="User Avatar" />
                    <input type="text" name="name" value={userInfo.name} onChange={handleChange} />
                    <input type="email" name="email" value={userInfo.email} onChange={handleChange} />
                    <input type="date" name="dob" value={userInfo.dob} onChange={handleChange} />
                    <textarea name="address" value={userInfo.address} onChange={handleChange} />
                    <button type="submit">Save Changes</button>
                </div>
            </form>
            <div className="social-info">
                <a href="/following">Following</a>
                <a href="/followers">Followers</a>
                <a href="/reviews">Reviews</a>
                <a href="/favorites">Favorites</a>
            </div>
        </div>
    );
}

export default Profile;
